import { useState, useEffect } from 'react';
import twelvedata from '../api/twelvedataAPI';
import { Actions } from '../interfaces/twelvedataAPI';

const useGetActions = () => {

    const [actions, setActions] = useState<Actions[]>([]);

    const loadActions = async () => {
        try {
            const res = await twelvedata.get('https://api.twelvedata.com/stocks?source=docs&exchange=BMV');
            console.log(res.data);
        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        loadActions();
    }, [])

    return (
        actions
    )
}

export default useGetActions
